const raw = items[0].json.text || '';

// 1) intenta bloque ```html ... ```
const mHtml = raw.match(/```html([\s\S]*?)```/i);
// 2) o bloque genérico ``` ... ```
const mAny  = raw.match(/```([\s\S]*?)```/);

let cleaned = mHtml?.[1] ?? mAny?.[1] ?? raw;
cleaned = cleaned.trim();

// (OPCIONAL) si después del bloque hay notas separadas por '---', córtalas
cleaned = cleaned.split('---')[0].trim();

return [{ json: { html: cleaned } }];
